import styled from "styled-components";

export const BigCircle = styled.button`
   height:3.5em;
   width:3.5em;
   border-radius:3.5em;
   background-color:#6C7B8A;
   bottom: 4em;
   right: 0.5em;
   z-index:100;
   position:fixed;
`
